PIAA LEDテクノロジーが生み出した圧倒的な明るさ"超TERA"LEDがさらに進化。<br><br>●新開発小型基板の開発により、純正バルブ規格サイズに準拠。<br>●純正バルブと同じサイズですので、製品寸法による取り付け可能車種を選びません。<br><br>●超高高照度LED「TERA」をトリプル搭載！<br>●最先端のテクノロジーでLEDを45°でマウント。さらに高拡散光学レンズを装備したフラッグシップモデル。<br>●美しい光として要望の多い、理想的な薄いブルーホワイトの6600K(ケルビン)とHIDを圧倒的に凌ぐ美しい光を放ちます。<br>●ヘッドライトのHID光に合わせて、ポジション球にベストマッチの最新鋭LEDです。 <br><br>●配線が不要なので取り付け簡単。（抵抗の取り付け不要、純正と差し替えるだけ）<br>●省消費電力のLEDでバッテリーへの負荷を低減。 <br>（純正白熱球：5W H-519：約1.25Wと消費電力約75%削減）<br>●車検対応<br><br>■色温度：6600K<br>■タイプ：T10<br>■品番：H-519<style type="text/css">
