★明るいLEDフォグバルブ<br>
業界最高レベルの2800lm（ルーメン）を<br>実現。<br>
※明るさはバルブ２ヶ（１台分の表記）<br>
★ハロゲンバルブ全光束比最大１８０％アップ<br>
※H16/PSX24W/PSX26W交換時の最大比較<br>
【優れた配光特性】<br>
バルブ毎にハロゲンバルブと同様の光中心（LCL）を実現。<br>
※LCL=Light Center Length<br>
【高い防水性能】<br>
JIS規格D0203噴水試験 最高レベルのS2クラスをクリア。<br>
【ハイブリッド/EV車対応】※12V車専用設計<br>
 高性能定電流回路を内蔵、最大28Vまでの高負荷対応設計。<br>
【高い放熱性能】<br>
 真夏の点灯、外気温50℃の環境下でも使用可能。<br>
 最適な電流/放<br>熱設計。<br>
【取付簡単】<br>
 電極性フリー回路を採用、装着時に検電せずカプラーオンで装着可能。<br>
【長寿命】<br>
 使用環境を想定した精密設計により、10,000時間以上の長寿命を実現。※写真はイメージです。<br>
<br>
